import "./App.css";

const BASE_URL = "http://localhost:9292/appointments";

function App() {
  fetch(BASE_URL)
    .then((r) => r.json())
    .then((data) => console.log(data));

  return (
    <div className="App">
      <header className="App-header">
        <p>Hello Phase 3 project</p>
      </header>
    </div>
  );
}

export default App;
